  const removeReview = (e) => {
        e.preventDefault();
        e.stopPropagation();
    }

  return (
    <li>

      <div className="labelContent">
        <div>{review.paragraph_text}</div>
        <div row col-sm-2 p-left-right-0 m-left-right-0>
        <ColumnGridRadioButtonGroups />
        </div>

      </div>

    </li>
  );
};

export default ReviewItem;;
